import React from "react";
function Infor() {
  return (
    <div>
      <span style={{padding:16}}>Information</span>
      <div style={{padding: 24,background: "#fff", height: "90vh" }}>
        <p>UserName</p>
        <p>Email</p>
        <p>Password</p>
      </div>
    </div>
  );
}
export default Infor;
